I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io api. I've been able to get the contents of the clipboard using the `clipboard` crate, but I'm having trouble figuring out how to use the elevenlabs.io api to read the contents aloud.

Here's what I have so far:

```
use clipboard::ClipboardProvider;
use reqwest::Url;
use serde::Deserialize;
use std::error::Error;

#[derive(Deserialize)]
struct ElevenLabsResponse {
    text: String,
}

async fn read_clipboard() -> Result<String, Box<dyn Error>> {
    let text = ClipboardProvider::new().get_contents()?;
    Ok(text)
}

async fn read_text(text: &str) -> Result<(), Box<dyn Error>> {
    let url = Url::parse("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")?;
    let client = reqwest::Client::new();
    let response = client
        .post(url)
        .header("Content-Type", "application/json")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json::<ElevenLabsResponse>()
        .await?;

    // Play the audio response here
    Ok(())
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn Error>> {
    let text = read_clipboard().await?;
    read_text(&text).await?;
    Ok(())
}
```

I'm not sure how to play the audio response from the elevenlabs.io api. I've tried using the `rodio` crate to play the audio, but I'm not sure how to convert the response from the api into a format that `rodio` can play.

Any help would be greatly appreciated!

